import features1 from './assets/images/dummy/features-1.svg';
import features2 from './assets/images/dummy/features-2.svg';
import features3 from './assets/images/dummy/features-3.svg';
import features4 from './assets/images/dummy/features-4.svg';
import features5 from './assets/images/dummy/features-5.svg';
import features6 from './assets/images/dummy/features-6.svg';
import OurServiceItem from './OurServiceItem';


const OurService = () => {

  const ourServiceItem = [
    {
      image: features1,
      title: 'Serch Doctor',
      desc: 'Choose your doctor from thousands of specialist, general, and trusted hospitals'
    },
    {
      image: features2,
      title: 'Serch Doctor',
      desc: 'Choose your doctor from thousands of specialist, general, and trusted hospitals'
    },
    {
      image: features3,
      title: 'Serch Doctor',
      desc: 'Choose your doctor from thousands of specialist, general, and trusted hospitals'
    },
    {
      image: features4,
      title: 'Serch Doctor',
      desc: 'Choose your doctor from thousands of specialist, general, and trusted hospitals'
    },
    {
      image: features5,
      title: 'Serch Doctor',
      desc: 'Choose your doctor from thousands of specialist, general, and trusted hospitals'
    },
    {
      image: features6,
      title: 'Serch Doctor',
      desc: 'Choose your doctor from thousands of specialist, general, and trusted hospitals'
    },
  ]

  return (
    // our-services
    <div class="service" id="find-a-doctor">
      <div class="container">
        <div class="service__head">
          <h3 class="text-title">Our services</h3>
          <p class="text-desc">We provide to you the best choiches for you. Adjust it to your health needs and make sure your undergo treatment with our highly qualified doctors you can consult with us which type of service is suitable for your health</p>
        </div>
        <div class="service__body">
          <div class="service__list">
            { ourServiceItem.map((v, i) => {
              return (
                <OurServiceItem key={`os-${i}`} image={v.image} title={v.title} desc={v.desc} />
              )
            })}
          </div>
        </div>
        <div class="service__footer">
          <a class="btn btn--secondary" href="#">Learn more</a>
        </div>
      </div>
    </div>
  )
}

export default OurService;
